create table address (
	address_id INT,
	is_permanent_residence VARCHAR(50),
	is_current_residence VARCHAR(50),
	first_name VARCHAR(50),
	middle_init VARCHAR(50),
	last_name VARCHAR(50),
	address VARCHAR(50),
	state VARCHAR(50),
	city VARCHAR(50),
	Issued_id INT,
	country VARCHAR(50),
	postalcode VARCHAR(50)
);
